// Map dimensions...
const int h = 152;
const int w = 196;

int xOffset[] = {0,0,1,-1,1,1,-1,-1};
int yOffset[] = {1,-1,0,0,1,-1,1,-1};
float ncosts[] = {1,1,1,1,1,1,1,1};

// Hardcoded starting point?...
int sx = 130;
int sy = 90;
FVector2D start = FVector2D(sx, sy);


TArray<FVector2D> UCustomPathfindingLibrary::getPath(int gx, int gy)
{
	int xPointer[h*w];
	int yPointer[h*w];
	float gPointer[h*w];
	bool checkedMap[h*w];
	std::priority_queue<MapLoc, std::vector<MapLoc>, std::greater<MapLoc> > q;
	MapLoc startLoc = MapLoc(sx, sy, 0.0, std::max(abs(sx - gx),abs(sy - gy)));
	q.push(startLoc);

	for (int i = 0; i < h*w; i++) {
		checkedMap[i] = false;
		xPointer[i] = 0;
		yPointer[i] = 0;
		gPointer[i] = 1e16;
	}

	bool found = false;
	while (!q.empty()){
		MapLoc current = q.top();
		if (current.getX() == gx && current.getY() == gy) {
			found = true;
			break;
		}
		checkedMap[current.getY() * w + current.getX()] = true;
		q.pop();

		for (int i = 0; i < 8; i++) {
			int nx = current.getX() + xOffset[i];
			int ny = current.getY() + yOffset[i];
			float nG = current.getG() + ncosts[i];
			int index = ny * w + nx;

			if (checkedMap[index] || tempMap[index] == 0 || gPointer[index] <= nG) {
				continue;
			}

			float nH = std::max(abs(nx - gx),abs(ny - gy));
			xPointer[index] = current.getX();
			yPointer[index] = current.getY();
			gPointer[index] = nG;
			q.push(MapLoc(nx, ny, nG, nH));
		}
		
	}

	TArray<FVector2D> ans;
	if (found) {
		int indexGoal = gy * w + gx;
		int indexStart = sy * w + sx;
		ans.Add(FVector2D(gx,gy));
		while (indexGoal != indexStart) {
			int cx = xPointer[indexGoal];
			int cy = yPointer[indexGoal];
			ans.Add(FVector2D(cx, cy));
			indexGoal = cy * w + cx;
		}
	}
	return ans;
}


// MapLoc Functions...

MapLoc::MapLoc(int x, int y, float g, float h): x(x), y(y), g(g), h(h)
{
}

float MapLoc::getG() const
{
	return g;
}

float MapLoc::getH() const
{
	return h;
}

int MapLoc::getX() const
{
	return x;
}

int MapLoc::getY() const
{
	return y;
}


bool operator<(const MapLoc & lhs, const MapLoc & rhs)
{
	return lhs.getG() + lhs.getH() < rhs.getG() + rhs.getH();
}
bool operator>(const MapLoc & lhs,const MapLoc & rhs)
{
	return lhs.getG() + lhs.getH() > rhs.getG() + rhs.getH();
}